import React, { Component } from 'react'
import CardContainer from '../CardContainer/CardContainer'
import { Tabs, Icon } from 'antd';
const { TabPane } = Tabs;

export default class Events extends Component {
    render() {
        return (
            <TabPane
                tab={
                    <span>
                        <Icon type="credit-card" />
                        Events
                            </span>
                }
                key="1"
            >
                <CardContainer />
            </TabPane>

        )
    }
}
